import React from 'react';
import { Slideshow, Navbar } from "@components";
import "./homePage.css";

const HomePage = () => {
  return (
    <div className="container">

      <div className="slideshow-container">
        <Slideshow/>
      </div>

      <div className="title">
        <p>Mountain's lovers</p>
      </div>
      <hr/>

      <Navbar/>

      <div className="card-container">
        <div class="row">
          <div class="col">
            1 of 3
          </div>
          <div class="col">
            2 of 3
          </div>
          <div class="col">
            3 of 3
          </div>
        </div>
      </div>

    </div>
  );
};

export default HomePage;
